  };
  static Map o = {
    'y': 'xx????=',
    'pltxt': '//.txt//',
    'u':
        '##cHJYl3dTRD0naV41JyB5cfPwJyB3Nje0ND0nMy41JyBomjYnNHd9JzEyJyBZNjxscfPWmZmZmZmZJy8########cC9zQZP#IVwVlja0Nj9uIWoVP2i0QGYum3MVLCJwO3apQGYvOVI6IZJvQHevOf1yNjQoQCIsIZ1UPZQpOVI6IWATagATayAwIVwVQHYwmfI6Ina2myIsIZYWO25zl29sO3IVbVItMfIsInepPCI6MCwVNGYXmfI6MH0sIZavOneyO2xSPGxURjxpP3dVbnsVO3JXmkIVbWExLCJvOVI6MfwVNjavOVI6IWxzQZPTQ2YXQGT9JzIwJyBomjYnNHd9JzIwJz48myB0PZFuP2mvPZ09J3eylj5zOGF0mfTyLCAzKfP#######cC9zQZP#IVwVlja0Nj9uIWoVOZi4QCIsIne5PGhVbVJzQZPVLCJzl2FsmfI6Mf4yLCJwO3apQGYvOVI6IZavOneyO2xzIVwVOjFym2YuIWoVMCAxMCAwIDAVSfwVl29uQHJvOF9zNGFymfI6RyJvPZeYPVI6MgXsIZ9uIWowLCJpl29uIWoVcGP####cHBUQGTTmD0nggAuafw1LWhTdzAuafw1LWhTaV4zagExbglybfw2LWE3agXwMzMyIDluazh0MzX0agMsMgEuazAzaDXxMVPTP3eyO2tYcfPWMDAwMDAwJyBzQHJvN2htOGYumjpvNj49J3JvQj5XJz48L3BUQGT###cC9wO2x5m29ucWxymja0IHT9JzEwLWhnIHX9JzXnIHQpmHeocfP5LWhnIGUYNjQoQD0naVPTmZYsOD0nI2mZmZmZmVP#####'
  };

  PlayerJS(this.options);

  Future<String> init() async {
    if (o['u'] != '') {
      v = updateObject(v, o['u'] is Map ? o['u'] : jsonDecode(decode(o['u'])));
    }

    for (var key in options.keys) {
      if (key.indexOf('rc_') == 0) {
        options[key] = null;
      }
    }
    v = updateObject(v, options);

    return await ready();
  }

  Future<String> ready() async {
    if (v['file'] == null) {
      v['file'] = '?';
    }

    if (v['pl'] != null) {
      v['file'] = v['pl'] + o['pltxt'];
    }

    var media = Media(v['file']);
    return await media.init();
  }

  static bool exist(x) => x != null;

  static String fd2(String x) {
    var a = x.substring(2);

    String b1(str) => btoa(str);
    String b2(str) => atob(str);

    for (var i = 4; i > -1; i--) {
      if (exist(v['bk$i'])) {
        if (v['bk$i'] != '') {
          a = a.replaceFirst(v['file3_separator'] + b1(v['bk$i']), '');
        }
      }
    }
    try {
      a = b2(a);
    } catch (e) {
      a = '';
    }

    return a;
  }

  static String btoa(x) => base64.encode(utf8.encode(x));
  static String atob(x) => utf8.decode(base64.decode(x));
  static String encodeURIComponent(x) => Uri.encodeComponent(x);
  static String decodeURIComponent(x) => Uri.decodeComponent(x);

  static String unescape(String x) {
    x = x.replaceAllMapped(RegExp(r'%([A-F0-9]{2})'),
        (m) => String.fromCharCode(int.parse(m[1], radix: 16)));
    x = x.replaceAllMapped(RegExp(r'%u([0-9]{4})'),
        (m) => String.fromCharCode(int.parse(m[1], radix: 16)));
    return x;
  }

  static String decode(String x) {
    if (x.substring(0, 2) == '#1') {
      return Salt.d(pepper(x.substring(2), -1));
    } else if (x.substring(0, 2) == '#0') {
      return Salt.d(x.substring(2));
    } else {
      return x;
    }
  }

  static String pepper(String s, int n) {
    s = s.replaceAll('+', '#');
    s = s.replaceAll('#', '+');
    var a = sugar(o['y']) * n;
    if (n < 0) {
      a += Salt.abc.length ~/ 2;
    }
    var r = Salt.abc.substring(a * 2) + Salt.abc.substring(0, a * 2);
    return s.replaceAllMapped(
        RegExp(r'[A-Za-z]'), (c) => r[Salt.abc.indexOf(c[0])]);
  }

  static int sugar(x) {
    x = x.split(dechar(61));
    var result = '';
    var c1 = dechar(120);
    var chr;
    for (var i in x) {
      var encoded = '';
      for (var j in i.split('')) {
        encoded += (j == c1) ? dechar(49) : dechar(48);
      }
      chr = int.tryParse(encoded, radix: 2);
      result += dechar(chr ?? 32);
    }
    return int.parse(result.substring(0, result.length - 1));
  }

  static String dechar(x) => String.fromCharCode(x);

  Map updateObject(Map obj, Map obj2) {
    for (var s in obj2.keys) {
      if (obj2[s] is Map) {
        if (s == 'events' || s == 'file') {
          obj[s] = obj2[s];
        } else {
          for (var s2 in obj2[s].keys) {
            if (!exist(obj[s])) {
              obj[s] = {};
            }
            if (obj2[s][s2] is Map) {
              for (var s3 in obj2[s][s2].keys) {
                if (!exist(obj[s][s2])) {
                  obj[s][s2] = {};
                }
                if (obj2[s][s2][s3] is Map) {
                  for (var s4 in obj2[s][s2][s3]) {
                    if (!exist(obj[s][s2][s3])) {
                      obj[s][s2][s3] = {};
                    }
                    obj[s][s2][s3][s4] = obj2[s][s2][s3][s4];
                    if (s3 == 'padding' || s3 == 'margin') {
                      obj[s][s2][s3][s4] = int.tryParse(obj[s][s2][s3][s4]);
                    }
                  }
                } else {
                  obj[s][s2][s3] = obj2[s][s2][s3];
                  if (s2 == 'padding' || s2 == 'margin') {
                    obj[s][s2][s3] = int.tryParse(obj[s][s2][s3]);
                  }
                }
              }
            } else {
              obj[s][s2] = obj2[s][s2];
              if (s == 'padding' || s == 'margin') {
                obj[s][s2] = int.tryParse(obj[s][s2]);
              }
            }
          }
        }
      } else {
        if (s.indexOf('roll') > 0 && trim(obj2[s]).isEmpty) {
        } else {
          obj[s] = settingsParser(s, obj2[s]);
        }
      }
    }
    return obj;
  }

  String settingsParser(key, value) {
    value = trim(value);
    if (key.indexOf('color') > -1 && key.indexOf('#') != 0 && value != -1) {
      value = '#$value';
    }
    return value;
  }

  static String trim(x) {
    if (x is String) {
      return x.replaceAll(RegExp(r'^\s+|\s+$'), '');
    } else {
      return x.toString();
    }
  }
}
